    struct SchemaField {
        string fieldName;
        DataType dataType;
        bool required;
        string description;
        string validationRule;
        string defaultValue;
    }

    /**
     * @dev Reserved subdomain schema information
     */
    struct ReservedSubdomainSchema {
        string subdomain;
        SchemaPriority priority;
        string category;
        string description;
        string version;
        string ccipInterface;
        SchemaField[] fields;
        string[] allowedRoles;
        string[] restrictions;
        bool active;
        uint256 createdAt;
        uint256 updatedAt;
        string apiEndpoint;
        string documentationUrl;
    }

    /**
     * @dev CCIP-compatible data structure
     */
    struct CCIPData {
        string subdomain;
        string schemaVersion;
        bytes32 dataHash;
        uint256 timestamp;
        address dataProvider;
        bool isValid;
        string[] fieldNames;
        bytes[] fieldValues;
    }

    /**
     * @dev Events
     */
    event SchemaDefined(
        string indexed subdomain,
        SchemaPriority priority,
        string category,
        string version,
        address indexed definedBy
    );

    event SchemaUpdated(
        string indexed subdomain,
        string oldVersion,
        string newVersion,
        address indexed updatedBy
    );

    event SchemaDeprecated(
        string indexed subdomain,
        string version,
        address indexed deprecatedBy
    );

    event CCIPDataStored(
        string indexed subdomain,
        bytes32 indexed dataHash,
        address indexed dataProvider
    );

    event RoleAdded(
        string indexed subdomain,
        string role,
        address indexed addedBy
    );

    event RoleRemoved(
        string indexed subdomain,
        string role,
        address indexed removedBy
    );

    /**
